import styled from "styled-components";

const Header = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 60px;
  padding: 0px 30px;
  background: rgb(156, 141, 143);
  background: linear-gradient(
    0deg,
    rgba(156, 141, 143, 1) 0%,
    rgba(132, 117, 119, 1) 100%
  );
`;

const Navigatie = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 100%;
  padding: 0px 10px;
`;

const Logo = styled.div``;

const ButtonsHeader = styled.div`
  display: flex;
`;

const ButtonHeader = styled.button`
  height: auto;
  width: auto;
  margin: 10px;
  text-align: center;
  font-size: 20px;
`;

const Searchbar = styled.div``;

const AccountButton = styled.div`
  background: grey;
  height: 45px;
  width: 45px;
`;

const Container = styled.div`
  width: auto;
  height: auto;
  background: #fffcf6;
`;

const Home = () => {
  //const [pokemonData, setPokemondata] = useState([]);
  //const [value, setValue] = useState("");

  useEffect(() => {
    //fetchAllPokemons();
  }, []);

  return (
    <div className="site">
      <Header>
        <Logo>
          <div className="header_image_site">logo</div>
        </Logo>
        <Navigatie>
          <ButtonsHeader>
            <ButtonHeader>Novels</ButtonHeader>
            <ButtonHeader>Art</ButtonHeader>
          </ButtonsHeader>
          <Searchbar>
            <div className="searchbar_header">S</div>
          </Searchbar>
          <AccountButton>
            <div className="account_button">A</div>
          </AccountButton>
        </Navigatie>
      </Header>
      <Container>
        <div className="container">Hoi</div>
      </Container>
    </div>
  );
};

export default Home;
